import React, { useState } from 'react';
import styled from 'styled-components';

export default function FraudDetector() {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        phone: '',
        address: '',
        city: '',
        country: '',
        postalCode: '',
    });
    const [result, setResult] = useState('');

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        setResult(JSON.stringify(formData, null, 2));
    };

    return (
        <DetectorStyled>
            <div className="form-container">
                <h1 className="header">Fraud Detector Form</h1>
                <form onSubmit={handleSubmit} className="form">
                    {Object.keys(formData).map((field) => (
                        <div key={field} className="field-container">
                            <label htmlFor={field} className="label">
                                {field.replace(/([A-Z])/g, ' $1').trim()}
                            </label>
                            <input
                                id={field}
                                name={field}
                                value={formData[field]}
                                onChange={handleChange}
                                className="input"
                                required
                            />
                        </div>
                    ))}
                    <button type="submit" className="submit-btn">
                        Submit
                    </button>
                </form>
                {result && (
                    <div className="result-container">
                        <h3 className="result-header">Result:</h3>
                        <pre className="result-text">{result}</pre>
                    </div>
                )}
            </div>
        </DetectorStyled>
    );
}

const DetectorStyled = styled.div`
    min-height: 80vh;
    background-color: rgba(252, 246, 249, 0.78);
    display: flex;
    align-items: center;
    justify-content: center;
    padding: 1.5rem;

    .form-container {
        width: 100%;
        max-width: 500px;
        background: white;
        border-radius: 16px;
        box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.1);
        padding: 1.5rem;
    }

    .header {
        background-color: #ff4136;
        color: white;
        padding: 1rem;
        margin: -2rem -2rem 1.5rem -2rem;
        border-radius: 16px 16px 0 0;
        font-size: 1rem;
        text-align: center;
    }

    .form {
        display: flex;
        flex-direction: column;
        gap: 1rem;
    }

    .field-container {
        display: flex;
        flex-direction: column;
        gap: 0.5rem;
    }

    .label {
        color: #222260;
        font-size: 0.8rem;
        font-weight: bold;
        text-transform: capitalize;
    }

    .input {
        padding: 0.8rem;
        border-radius: 8px;
        border: 1px solid rgba(34, 34, 96, 0.6);
        font-size: 1rem;
        transition: border-color 0.3s;
        &:focus {
            border-color: #222260;
        }
    }

    .submit-btn {
        background-color: #222260;
        color: white;
        padding: 0.8rem 1rem;
        border: none;
        border-radius: 8px;
        font-size: 1rem;
        cursor: pointer;
        transition: background-color 0.3s;

        &:hover {
            background-color: #1a1a50;
        }
    }

    .result-container {
        margin-top: 1.5rem;
        background-color: rgba(252, 246, 249, 0.78);
        padding: 1rem;
        border-radius: 8px;
        box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.1);
    }

    .result-header {
        color: #222260;
        font-size: 1.2rem;
        margin-bottom: 0.5rem;
    }

    .result-text {
        color: #222260;
        font-size: 0.9rem;
        white-space: pre-wrap;
    }
`;
